eq j\) is said to be a diagonal matrix : \[ \left[  egin{array}{rrr} 1 & 0 & 0 \ 0 & -1 & 0 \ 0 & 0 & 5 \end{array} ight] \] Consider in particular the following diagonal matrix: \[ \I = \left[  egin{array}{rrr} 1 & 0 & 0 \ 0 & 1 & 0 \ 0 & 0 & 1 \end{array} ight] \] Note that this matrix has the interesting property that \((\A\I)_{ij}=A_{ij}\) for all \(i, , j\); in other words, \(\A\I=\I\A=\A\). Because of this property, \(\I\) is referred to as the identity matrix . Some other notations which are commonly used are \(\one\), the vector (or matrix) of 1s, and \(\zero\), the vector (or matrix) of zeros: \[ \one = \left[  egin{array}{rrr} 1\ 1\ 1 \end{array} ight] \qquad \zero = \left[  egin{array}{rrr} 0\ 0\ 0 \end{array} ight] \] The dimensions of these matrices is sometimes explicitly specified, as in \(\zero_{2 	imes 2}\), \(\I_{5 	imes 5}\), or \(\one_{4 	imes 1}\). Other times it is obvious from context what the dimensions must be. Finally, the vector \(\e_j\) is also useful: it has element \(e_j=1\) and \(e_k=0\) for all other elements: \[ \e_2 = \left[  egin{array}{rrr} 0 \ 1 \ 0 \end{array} ight]. \] This is useful for selecting a single element of a vector: \(\u \Tr \e_3 = u_3\).

